pragma solidity 0.6.12;

import {GenMarketPlace} from "./GenMarketPlace.sol";
import './interfaces/IGenMarketPlaceFactory.sol';
import "@openzeppelin/contracts/math/SafeMath.sol";

contract GenMarketPlaceFactory is IGenMarketPlaceFactory {
    using SafeMath for uint;

    // Address that receives fees
    address public override feeTo;

    // for buy implementation
    uint256 public override feeDivisor;

    // for purchase implementation in wei format eg 2.75 % = 2750000000000000000
    uint256 public override feeMultiplier;

    // Address that gets to set the feeTo address
    address public override feeToSetter;

    // List of genMarket addresses
    address[] public override genMarkets;

    mapping(address => uint) public override getGenMarket;
    // Base ticket address to market address
    mapping(address => address) public override ticketToMarket;

    event MarketCreated(address indexed caller, address indexed genMarket);

    function genMarketsLength() external override view returns (uint) {
        return genMarkets.length;
    }

    constructor(address _feeToSetter) public {
        feeToSetter = _feeToSetter;
    }

    function createGenMarketPlace(
        address _genTicket,
        // Prices are in ETH
        uint256[] memory _prices,
        // Number of each ticket type being sold
        uint256[] memory _numTicketsTransferable
        // uint256[] memory _purchaseLimits
    ) external override returns (address) {
        require(_numTicketsTransferable.length == _prices.length, 'GenMarketFactory: ARRAY SIZE MISMATCH');
        //address creator = msg.sender;
        GenMarketPlace gmp = new GenMarketPlace(_genTicket, _prices, _numTicketsTransferable, this, msg.sender);
        // Populate mapping
        getGenMarket[address(gmp)] = genMarkets.length;
        ticketToMarket[_genTicket] = address(gmp);
        // Add to list
        genMarkets.push(address(gmp));
        emit MarketPlaceCreated(msg.sender, address(gmp));

        return address(gmp);
    }

    function setFeeTo(address _feeTo) external override {
        require(msg.sender == feeToSetter, 'GenMarketPlaceFactory: FORBIDDEN');
        feeTo = _feeTo;
    }

    function setFeeToSetter(address _feeToSetter) external override {
        require(msg.sender == feeToSetter, 'GenMarketPlaceFactory: FORBIDDEN');
        feeToSetter = _feeToSetter;
    }

    function setFeeDivisor(uint256 _feeDivisor) external override {
        require(msg.sender == feeToSetter, 'GenMarketPlaceFactory: FORBIDDEN');
        require(_feeDivisor > 0, "GenMarketPlaceFactory: Fee divisor must not be zero");
        feeDivisor = _feeDivisor;
    }

    function setFeeMultiplier(uint256 _feeMultiplier) external override {
        require(msg.sender == feeToSetter, 'GenMarketPlaceFactory: FORBIDDEN');
        feeMultiplier = _feeMultiplier;
    }
}
